interface TimeLineData{
  dateTime :String;
  title : String;
  link? : URL ; 
} 

function timeLineItem(data:TimeLineData):JSX.Element {

  let detail :JSX.Element =data.link ?  
  null : 
 <div className={styles.timeLineLink}><Link href={data.link} text-align="right"> Explore this</Link></div>;
 

  return(
     <TimelineItem >
       
          <TimelineSeparator>
            <TimelineDot variant="outlined" />
            <TimelineConnector />
          </TimelineSeparator>
         
            <br></br>
          <TimelineContent className={styles.timeLineBG}>
          <div className={styles.dateColor}>
            {data.dateTime}
            </div>
  <div className={styles.timeLineTitle}>
  {data.title}
    </div>          

 <br></br>
  {detail}
          </TimelineContent>
          </TimelineItem>
  );
}

